import React, { Component } from 'react';
import Button from '@material-ui/core/Button';
import Header from './Header';
import history from './history';

class Plainte extends Component {

    render() {
      return (
          <div>
              <form>
                   <div class="form-group">
                       <label for="nom">Nom</label> 
                       <input id="nom" type="text" class="form-control" name="" placeholder="Entrer votre nom"></input>
                   </div>

                 <div class="form-group">
                        <label for="mail">Email</label> 
                        <input id="mail" type="text" class="form-control" name="" placeholder="Entrer votre mail"></input>
                 </div>
             </form>
           </div>



      );
    }

  }


export default Plainte;
